import base64

# Vervang dit door jouw base64-string (zonder de data:image/png;base64, header als die erbij staat)
base64_string = ""  # (vervang door je volledige string)

# Decodeer de base64-string
image_data = base64.b64decode(base64_string)

# Schrijf het naar een bestand
with open("output_image.png", "wb") as f:
    f.write(image_data)

print("Afbeelding opgeslagen als 'output_image.png'")
